      SELECT ALL - 96, - 11 AS col1 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1 WHERE NOT 13 IS NULL;
  - name: tab0
  - name: tab2

outputs:
